Luxembourgish national mobile app to check EU Digital COVID Certificates - The app allows to check in real-time the authenticity and validity of documents issued in the context of the EU Digital COVID Certificate #EUCOVIDCertificate:
• certificate of recovery;
• vaccination certificate;
• test certificate.

The app allows users to:
• scan the QR code on the certificate;
• check the authenticity and the validity of the certificate.

Beneficii medicale simplificate de tehnologie

SanoPass este platforma care conectează, digitalizează, customizează și integrează toate serviciile de prevenție medicală. Conceptul SanoPass este unic în Europa, fiind singurul integrator de servicii medicale care asigură transparență, flexibilitate și adaptabilitate în acordarea de beneficii de sănătate.
Serviciile SanoPass pot fi accesate printr-un abonament primit de la angajator sau printr-un abonament individual, achiziționat direct din aplicația mobilă

Cum funcționează? 
1. Te înregistrezi în aplicația SanoPass;
2. Alegi clinica în care dorești să mergi;
3. Validezi vizita în clinică prin scanarea codului QR;
4. Beneficiezi de serviciile medicale solicitate;
5. Primești raportul medical sau rezultatele în aplicație.

Приложение для пациентов Многопрофильного медицинского центра GMS Clinic.
Оставайтесь на связи с лечащим врачом или клиникой в любой ситуации:

– Записывайтесь на прием к врачу прямо из приложения;

– Проходите плановые приемы с помощью онлайн-консультаций;

– Используйте чат для общения с клиникой и уточнения деталей приемов;

– Храните заключения, результаты обследований и анализов в одном месте;

– Следите за приемом лекарств и своей реакцией – а приложение напомнит;

– Просматривайте план лечения, свой или членов вашей семьи;

– Объедините данные о здоровье всей семьи с помощью функции «Семейный профиль».

Как получить доступ к приложению?

Зарегистрируйтесь.
Во время визита в клинику обратитесь к администратору, сообщите свои фамилию, имя и отчество и попросите подключить вас к системе, если вы уже являетесь клиентом клиники. Если вы новый пациент, то сперва необходимо подписать договор с клиникой.
После подключения мы свяжем ваш профиль с профилем в системе клиники. Вы сможете пользоваться полным функционалом приложения.

